 class Movielist extends Component {
  render() {
    return <div className='row'>

        {this.props.movies.map((movie)=>(
             <div  className='col-lg-4'>
             <div className='card mb-4 shadow-sm'>
                 <img className='card-img-top' alt="sample movie" src='https://image.tmdb.org/t/p/w600_and_h900_bestv2/qCPMjT8Ld8tvs1zs7LY2jpKlRIK.jpg'/>
                 <div className='card-body'>
                     <h5 className='card-title'>Sample movie</h5>
                     <p className='card-text'>.........Sample movie dewscrpitpoın.............</p>
                     <div className='d-flex justify-content-between align-items-center'>
                         <button className='btn btn-md btn-outline-danger'>Delete</button>
                         <h2 ><span className='badge badege-info'>5,4</span></h2>
                     </div>
                 </div>
             </div>
         </div>
        ))}
        
    </div>;
  }
}
export default Movielist;
